document.addEventListener("DOMContentLoaded", function() {
  const music = document.getElementById("music");
  const toggleBtn = document.getElementById("toggle-btn");
  const musicIcon = document.getElementById("music-icon");

  // Function to toggle music play/pause
  function toggleMusic() {
    if (music.paused) {
      music.play();
      musicIcon.src = "musicon.png"; // Change to music on icon
    } else {
      music.pause();
      musicIcon.src = "musicoff.png"; // Change to music off icon
    }
  }

  // Event listener for the toggle button
  toggleBtn.addEventListener("click", toggleMusic);
});


function openPdfPopup() {
  document.getElementById('pdf-popup').style.display = 'block';
}

function closePdfPopup() {
  document.getElementById('pdf-popup').style.display = 'none';
}

document.getElementById('services-link').addEventListener('click', function(event) {
  event.preventDefault(); // Prevent default link behavior

  // Show the PDF popup
  openPdfPopup();
});

